cell_type":"markdown","id":"8be4056c","metadata":{"papermill":{"duration":0.030745,"end_time":"2022-04-23T13:55:48.377277","exception":false,"start_time":"2022-04-23T13:55:48.346532","status":"completed"},"tags":[]},"source":["Bellabeat is a high-tech company that manufactures health-focused smart products including Bellabeat app, Leaf, Time and Spring. It also offers a subscription-based membership program for users giving them access to personalised guidance on having a healthy lifestyle. Bellabeat has positioned itself as a tech-driven wellness company for women.\n","\n","Bellabeat has been investing extensively on digital marketing including Google Search and being active on social media platforms. Bellabeat invests year-round in Google Search, maintaining active Facebook and Instagram pages, and consistently engages consumers on Twitter. Additionally, Bellabeat runs video ads on Youtube and display ads on the Google Display Network to support campaigns around key marketing dates."]},{"cell_type":"markdown","id":"e7b4e4f6","metadata":{"papermill":{"duration":0.030702,"end_time":"2022-04-23T13:55:48.437334","exception":false,"start_time":"2022-04-23T13:55:48.406632","status":"completed"},"tags":[]},"source":["# Key StakeHolders\n","* Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer\n","* Sando Mur: Mathematician and Bellabeat’s co-founder; key member of the Bellabeat executive team"]},{"cell_type":"markdown","id":"ede81e63","metadata":{"papermill":{"duration":0.031749,"end_time":"2022-04-23T13:55:48.499578","exception":false,"start_time":"2022-04-23T13:55:48.467829","status":"completed"},"tags":[]},"source":["# Products:\n","\n","1. **Bellabeat app**: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits.\n","2. **Leaf**: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","3. **Time**: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress.\n","4. **Spring**: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","5. **Bellabeat membership**: Bellabeat also offers a subscription-based membership program for users."]},{"attachments":{"c8250fff-52d9-4798-bcc7-4147f25b12fd.png":{"image/png":""}},"cell_type":"markdown","id":"773d4d65","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"papermill":{"duration":0.03102,"end_time":"2022-04-23T13:55:48.558759","exception":false,"start_time":"2022-04-23T13:55:48.527739","status":"completed"},"tags":[]},"source":["![download.png](attachment:c8250fff-52d9-4798-bcc7-4147f25b12fd.png)"]},{"cell_type":"markdown","id":"27c6823d","metadata":{"papermill":{"duration":0.028067,"end_time":"2022-04-23T13:55:48.615455","exception":false,"start_time":"2022-04-23T13:55:48.587388","status":"completed"},"tags":[]},"source":["How  Fitbit's <Fitbit> [syncing](https://movespring.com/blog/how-syncing-your-fitness-tracker-works-8) works?\n","\n",">**\"The fitness tracker's sensor records data of accumulated steps in real-time, but the data stays local on the device. The fitness tracker will background sync the activity data to the device app on your phone  (i.e. the Fitbit app) at various intervals. Background syncing usually happens between 1–20 times per day and is up to the fitness tracker and its paired app to determine how often they sync.\"** - movespring.com"]},{"cell_type":"markdown","id":"4ab9fb29","metadata":{"papermill":{"duration":0.027403,"end_time":"2022-04-23T13:55:48.670195","exception":false,"start_time":"2022-04-23T13:55:48.642792","status":"completed"},"tags":[]},"source":["# **1. Ask Phase**"]},{"cell_type":"markdown","id":"6454cb51","metadata":{"papermill":{"duration":0.028803,"end_time":"2022-04-23T13:55:48.726917","exception":false,"start_time":"2022-04-23T13:55:48.698114","status":"completed"},"tags":[]},"source":["# Statement of business task\n","\n","To focus on a Bellabeat product and analyze smart device usage data in order to gain insight into how people are already using their smart devices. Then, using this information, give high-level recommendations for how these trends can inform Bellabeat marketing strategy.\n","\n","In one phrase we can say client requirement as:\n"," How do our users use our smart devices?"]},{"cell_type":"markdown","id":"ce67788e","metadata":{"papermill":{"duration":0.027998,"end_time":"2022-04-23T13:55:48.782859","exception":false,"start_time":"2022-04-23T13:55:48.754861","status":"completed"},"tags":[]},"source":["# **2. Prepare Phase**"]},{"cell_type":"markdown","id":"fa4a3b7f","metadata":{"papermill":{"duration":0.027964,"end_time":"2022-04-23T13:55:48.837882","exception":false,"start_time":"2022-04-23T13:55:48.809918","status":"completed"},"tags":[]},"source":["### **Dataset Description:**\n","\n","The data source used for our case study is ***FitBit Fitness Tracker Data***. This dataset is stored in Kaggle and was made available through Mobius.\n","\n","* **License**: CC0: Public Domain\n","\n","* **Last Updated**: 2020-12-16\n","\n","* **Credibility Of Data**: Dataset avilable through mobius.This dataset generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring."]},{"cell_type":"markdown","id":"fecdcfaa","metadata":{"papermill":{"duration":0.028019,"end_time":"2022-04-23T13:55:48.893259","exception":false,"start_time":"2022-04-23T13:55:48.86524","status":"completed"},"tags":[]},"source":["# **3. Process and Analyse Phase**"]},{"cell_type":"markdown","id":"75dac4e9","metadata":{"papermill":{"duration":0.027708,"end_time":"2022-04-23T13:55:48.949341","exception":false,"start_time":"2022-04-23T13:55:48.921633","status":"completed"},"tags":[]},"source":["I am using R in this project. R is an excellent programming language for data analysis and data visualization. Data cleaning effectively done in R. It can process large dataset faster compared to spreadsheets. It is also extensively used by many data enthuisiast.It has dynamic and active R community support. \n","\n","**Some of steps in this phase are:**\n","\n","1. Inspect and remove missing values from the created data frame.\n","2. Field names standardized.\n","3. Remove Duplicates as it disturbs analysis.\n","4. Remove erroneous outliers to get exact trend.\n","5. Convert data values into consistent metrics.\n","6. Merge & split columns as required.\n","7. Sort records in necessary order.\n","8. Remove irrelevant/machine-dependent columns\n","9. Fix typos if any.\n","\n","Let’s process data-frames of each dataset one by one."]},{"cell_type":"markdown","id":"92f438e8","metadata":{"papermill":{"duration":0.028403,"end_time":"2022-04-23T13:55:49.005548","exception":false,"start_time":"2022-04-23T13:55:48.977145","status":"completed"},"tags":[]},"source":["#### 1. **Installing Packages and Loading Libraries**\n","\n","We will install and use the following packages for our analysis:\n","\n","* tidyverse\n","* dplyr\n","* skimr\n","* ggplot2\n","* tidyr\n","* ggpubr\n","* ggrepel"]},{"cell_type":"code","execution_count":2,"id":"ade304d7","metadata":{"execution":{"iopub.execute_input":"2022-04-23T13:55:49.102525Z","iopub.status.busy":"2022-04-23T13:55:49.063417Z","iopub.status.idle":"2022-04-23T13:55:49.234995Z","shell.execute_reply":"2022-04-23T13:55:49.23305Z"},"papermill":{"duration":0.204436,"end_time":"2022-04-23T13:55:49.237572","exception":false,"start_time":"2022-04-23T13:55:49.033136","status":"completed"},"tags":[]},"outputs":[{"name":"stder