d*\n","* Astonishingly if we observe it reveals that the most calories burned are the **\"6k > & < 10k Steps\"** and **\"> 7 miles\"** which might indicate some kind of running activity that allows the user to traverse **large distance with fewer number of steps**.\n","\n","* Also the above visualization demonstrates the relation how the **\"> 10k Steps\"** in the mean distance category and the **\"<6k Steps\"** in the low distance category varies which portrays the fact that **speed** has high significance in **calories burnt**."]},{"cell_type":"code","execution_count":22,"id":"7667a66c","metadata":{"execution":{"iopub.execute_input":"2022-04-23T13:55:54.415465Z","iopub.status.busy":"2022-04-23T13:55:54.413619Z","iopub.status.idle":"2022-04-23T13:55:54.475334Z","shell.execute_reply":"2022-04-23T13:55:54.473196Z"},"papermill":{"duration":0.101921,"end_time":"2022-04-23T13:55:54.478183","exception":false,"start_time":"2022-04-23T13:55:54.376262","status":"completed"},"tags":[]},"outputs":[],"source":["#Now let's focus on the sleep quality, for that I will now make categories for the sleeping time and I will make a new table with the sleeping categories percent for each individual user type:\n","sleepType_by_userType <- merged_data %>%\n","group_by(Id) %>%\n","summarise(\n","user_type = factor(case_when(\n","    SedentaryMinutes > mean(SedentaryMinutes) & LightlyActiveMinutes < mean(LightlyActiveMinutes) & FairlyActiveMinutes < mean(FairlyActiveMinutes) & VeryActiveMinutes < mean(VeryActiveMinutes) ~ \"Sedentary\",\n","    SedentaryMinutes < mean(SedentaryMinutes) & LightlyActiveMinutes > mean(LightlyActiveMinutes) & FairlyActiveMinutes < mean(FairlyActiveMinutes) & VeryActiveMinutes < mean(VeryActiveMinutes) ~ \"Lightly Active\",\n","    SedentaryMinutes < mean(SedentaryMinutes) & LightlyActiveMinutes < mean(LightlyActiveMinutes) & FairlyActiveMinutes > mean(FairlyActiveMinutes) & VeryActiveMinutes < mean(VeryActiveMinutes) ~ \"Fairly Active\",\n","    SedentaryMinutes < mean(SedentaryMinutes) & LightlyActiveMinutes < mean(LightlyActiveMinutes) & FairlyActiveMinutes < mean(FairlyActiveMinutes) & VeryActiveMinutes > mean(VeryActiveMinutes) ~ \"Very Active\",\n","),levels=c(\"Sedentary\", \"Lightly Active\", \"Fairly Active\", \"Very Active\")),\n","sleep_type = factor(case_when(\n","    mean(TotalMinutesAsleep) < 360 ~ \"Bad Sleep\",\n","    mean(TotalMinutesAsleep) > 360 & mean(TotalMinutesAsleep) <= 480 ~ \"Normal Sleep\",\n","    mean(TotalMinutesAsleep) > 480 ~ \"Over Sleep\",\n","),levels=c(\"Bad Sleep\", \"Normal Sleep\", \"Over Sleep\")), total_sleep = sum(TotalMinutesAsleep) ,.groups=\"drop\"\n",") %>%\n","drop_na() %>%\n","group_by(user_type) %>%\n","summarise(bad_sleepers = sum(sleep_type == \"Bad Sleep\"), normal_sleepers = sum(sleep_type == \"Normal Sleep\"),over_sleepers = sum(sleep_type == \"Over Sleep\"),total=n(),.groups=\"drop\") %>%\n","group_by(user_type) %>%\n","summarise(\n","    bad_sleepers = bad_sleepers / total, \n","    normal_sleepers = normal_sleepers / total, \n","    over_sleepers = over_sleepers / total,\n","    .groups=\"drop\"\n",")"]},{"cell_type":"code","execution_count":23,"id":"db139d13","metadata":{"execution":{"iopub.execute_input":"2022-04-23T13:55:54.552779Z","iopub.status.busy":"2022-04-23T13:55:54.550643Z","iopub.status.idle":"2022-04-23T13:55:54.953983Z","shell.execute_reply":"2022-04-23T13:55:54.951684Z"},"papermill":{"duration":0.44417,"end_time":"2022-04-23T13:55:54.956767","exception":false,"start_time":"2022-04-23T13:55:54.512597","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3hTZRvH8fskTbp3oWWjbAoCMmQPQUEEXhWUKeIAARVEZCqibJAlL/iKouJE\ncbEERUVABJSlsocsKbNA90iTnPePlFpKaZM2JeXh+7m8vJJzntx9zsnd8OtJzomm67oAAADg\n5mfw9AQAAADgHgQ7AAAARRDsAAAAFEGwAwAAUATBDgAAQBEEOwAAAEUQ7AAAABRBsAMAAFAE\nwQ4AAEARBDsAAABFEOwAAAAUQbADAABQBMEOAABAEQQ7AAAARRDsAAAAFEGwAwAAUATBDgAA\nQBFenp4AcONMmPDLtm3n3F