ion":0.04263,"end_time":"2022-04-23T13:56:00.422833","exception":false,"start_time":"2022-04-23T13:56:00.380203","status":"completed"},"tags":[]},"source":["# **4.  Act Phase**"]},{"cell_type":"markdown","id":"baae63ef","metadata":{"papermill":{"duration":0.041577,"end_time":"2022-04-23T13:56:00.505664","exception":false,"start_time":"2022-04-23T13:56:00.464087","status":"completed"},"tags":[]},"source":["# Summarizing recommendations for the business"]},{"cell_type":"markdown","id":"55cc3e4d","metadata":{"papermill":{"duration":0.044822,"end_time":"2022-04-23T13:56:00.594916","exception":false,"start_time":"2022-04-23T13:56:00.550094","status":"completed"},"tags":[]},"source":["We already know, collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n","\n","After analyzing ***FitBit Fitness Tracker Data***, I found some **insights which would help Bellabeat grow by influencing its marketing strategy to make some changes.**"]},{"cell_type":"markdown","id":"ef762148","metadata":{"papermill":{"duration":0.04411,"end_time":"2022-04-23T13:56:00.682889","exception":false,"start_time":"2022-04-23T13:56:00.638779","status":"completed"},"tags":[]},"source":["**Women are the target audience of the stake holders**\n","\n","* So to the analysis, Women here are who work full-time jobs (as per hourly intensity data) and spend a lot of time focused on computer/in a meeting on work they are doing (as per the sedentary time data)\n","\n","* These women do some light activity to stay healthy (as per the activity type analysis). Even though they need to improve their everyday activity to have health benefits. \n","\n","* So the women might need some knowledge about developing healthy habits or motivation to keep going.\n","\n","**Limitation**: There is no gender information about the participants, So it is assumed that all genders were presented and balanced in this data set.\n","\n"]},{"cell_type":"markdown","id":"75d3d8e6","metadata":{"papermill":{"duration":0.042712,"end_time":"2022-04-23T13:56:00.769211","exception":false,"start_time":"2022-04-23T13:56:00.726499","status":"completed"},"tags":[]},"source":["### **Bellabeat marketing campaign vital quote:**\n","\n","Bella Beat is not another fitness tracker app alone but also it’s self guide or a  supporting friend who empowers women to balance full personal and professional life and healthy habits and routines by educating and motivating them through daily app recommendations."]},{"attachments":{"d77618f7-abb1-4856-9c06-ac441ea01332.png":{"image/png":""}},"cell_type":"markdown","id":"61a0dd65","metadata":{"papermill":{"duration":0.043104,"end_time":"2022-04-23T13:56:00.855242","exception":false,"start_time":"2022-04-23T13:56:00.812138","status":"completed"},"tags":[]},"source":["![download.png](attachment:d77618f7-abb1-4856-9c06-ac441ea01332.png)"]},{"cell_type":"markdown","id":"a7f8652e","metadata":{"papermill":{"duration":0.044153,"end_time":"2022-04-23T13:56:00.941615","exception":false,"start_time":"2022-04-23T13:56:00.897462","status":"completed"},"tags":[]},"source":["### **Recommendations for the Bellabeat app**\n","\n","1. Average total steps per day are 7638 which a little bit less for having health benefits for according to the CDC research. They found that taking 8,000 steps per day was associated with a 51% lower risk for all-cause mortality (or death from all causes). Taking 12,000 steps per day was associated with a 65% lower risk compared with taking 4,000 steps. Bellabeat can **encourage people** to take at least **8000 steps** explaining the benefits for their health.\n","\n","2. If users want to lose weight, it’s probably a good idea to control daily calorie consumption. Bellabeat can **suggest** some ideas for **low-calorie lunch and dinner**.\n","\n","3. If users want to improve their sleep, Bellabeat should consider using **app notifications to go to bed.**\n","\n","4. Most activity happens between *12pm - 2pm and 5 pm - 7 pm* .\n","\n","   At that time, people would go to a gym or for a walk after finishing work and they walk or do some activity during lunch hours. Bellabeat can use this time to **remind and motivate** users to go for a **run or walk.**\n","\n","5. According to the analysis **better quality sleep** is linked to the **activity level** which interestingly improves the sleep and in general to lowers stress and improving your quality of life. So startegy here is recommending to perform some sort of activity which helps users improves health quality also leads to users to use app more frequently to obsserve their pattern of activity.\n","\n","6. As an idea: if users want to improve their sleep, the Bellabeat app can recommend reducing sedentary time.\n","**Key Marketing Strategy** here is: In order to reduce sedantary time of users Bellabeat can come up with a game based approach reaching different levels if users walk for certain distance and rewarding the users with some points to be able to buy premium gadgets of Bellabeat."]},{"cell_type":"markdown","id":"6968d97c","metadata":{"papermill":{"duration":0.043406,"end_time":"2022-04-23T13:56:01.028732","exception":false,"start_time":"2022-04-23T13:56:00.985326","status":"completed"},"tags":[]},"source":["# **...............................................................................**\n","#  ................................ Thank you ...................................\n","# **...............................................................................**"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":18.522023,"end_time":"2022-04-23T13:56:01.193723","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-04-23T13:55:42.6717","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}